import React from 'react'
import { products } from '../../data/Data'
import ProductCard from './ProductCard'

function ProductList() {
  return (
    <div>
        {products.map((product, index)=> (

           <ProductCard product={product}/> 
        ))}
      
    </div>
  )
}

export default ProductList
